olkit/doc/trunk/DevGuide.html<\/a> <br><br> <h3>2.1 MVP<\/h3> <a href='http://code.google.com/webtoolkit/doc/trunk/DevGuideMvpActivitiesAndPlaces.html'>http://code.google.com/webtoolkit/doc/trunk/DevGuideMvpActivitiesAndPlaces.html<\/a> <br><br> <h3>2.1 API JavaDoc Reference<\/h3> <a href='http://google-web-toolkit.googlecode.com/svn/javadoc/2.1/index.html?overview-summary.html'>http://google-web-toolkit.googlecode.com/svn/javadoc/2.1/index.html?overview-summary.html<\/a>",b2="<center> <iframe frameborder='0' height='760' marginheight='0' marginwidth='0' src='https://spreadsheets.google.com/embeddedform?formkey=dDU5RENvMXZwMUladS15dzZpVml5NEE6MQ' width='760'>Loading...<\/iframe> <\/center>",X1="<center> <span id='",O1="<div id='contact'> <p>Feel free to email <a href='mailto:gwt@acrinta.com'>gwt@acrinta.com<\/a> for any comments or questions<\/p> <\/div>",i2="<div id='content'> <br> <h2>This Application<\/h2> <a href='http://github.com/ashtonthomas/gwt-seminar'>The Source Code for this Application<\/a> (MVP/DI/UiB) <br><br><br> <h2>More Samples (Coming Soon)<\/h2> <br><br><br> <table style='width:300px'> <tr> <td>MVP<\/td> <td>=<\/td> <td>Model-View-Presenter<\/td> <\/tr> <tr> <td>DI<\/td> <td>=<\/td> <td>Dependency Injection (Gin)<\/td> <\/tr> <tr> <td>FP<\/td> <td>=<\/td> <td>Factory Pattern<\/td> <\/tr> <tr> <td>M<\/td> <td>=<\/td> <td>Maven<\/td> <\/tr> <tr> <td>UiB<\/td> <td>=<\/td> <td>UiBinder<\/td> <\/tr> <\/table> <\/div>",$1="<div id='content'> <center><span id='",M1="<div id='content'> <p> This seminar is meant to help introduce advanced web developers to the new capabilities and ideas with the soon to be released Google Web Toolkit 2.1 (Release Candidate currently available) <br><br> Anyone is welcome to attend this free seminar. We only ask that you RSVP. The Information Systems Program at Carnegie Mellon along with Acrinta, LLC will host this event on November 30th at 6:00pm. <br><br> Feel free to contact <a href='mailto:gwt@acrinta.com'>gwt@acrinta.com<\/a> with any questions or comments about the seminar. <br><br> Since the seminar is bout learning GWT 2.1 and the popular topics dealing with building large \"enterprise\" web applications, we have built this small app using many of the ideas you will see in much larger GWT applications. We have also made the source code publicly available at:<br><br> <a href='http://www.github.com/ashtonthomas/gwt-seminar'>http://www.github.com/ashtonthomas/gwt-seminar<\/a> <\/p> <br><br> Here are some of the flyers for this event:<br> <br> <a href='http://www.andrew.cmu.edu/user/acthomas/flyer.pdf'>Click Here for Flyer 1<\/a><br><br> <a href='http://www.andrew.cmu.edu/user/acthomas/flyer2.pdf'>Click Here for Flyer 2<\/a><br><br> <a href='http://www.andrew.cmu.edu/user/acthomas/flyer3.pdf'>Click Here for Flyer 3<\/a> <\/div>",V1="<div id='content_area'> <h2>Zero to \"Enterprise\" in 60 minutes<\/h2> <br> <a href='#rsvp'>RSVP<\/a> for a free seminar on GWT 2.1 and building powerful Rich Internet Applications <br><br> <ul> <li>Model-View-Controller (MVP) with Activities<\/li> <li>EventBus and the Command Pattern<\/li> <li>Dependency Injection in client code using Gin<\/li> <li>Data Synchronization using the RequestFactory<\/li> <li>History and Navigation (keeping the \"back\" button)<\/li> <li>Decoupling UI's using UiBinder<\/li> <li>DTO's, Domains, and Databases<\/li> <li>Dependency Management / POM with Maven<\/li> <\/ul> <br><br> <h2>This site is a GWT App<\/h2> And you can download the source -&gt; <a href='http://github.com/ashtonthomas/gwt-seminar'>From GitHub<\/a>. <br><br><br><br> <h3>This site has a mobile version too<\/h3> Just to show how these things work in GWT.  <\/div>",Q1="<div id='wrapper'> <header> <h1>GWT 2.1 Seminar 2010<\/h1> <nav><ul> <li><span id='",k2="<h2>GWT Introduction<\/h2> <center> <object height='340' width='560'><param name='movie' value='http://www.youtube.com/v/ShkYDPN5Knc?fs=1&amp;hl=en_US&amp;rel=0'><param name='allowFullScreen' value='true'><pa
